INSERT INTO `os_product` VALUES ('2', '1472581245880', '2', '小米MIX', '3499', '3499.00', '全面屏概念手机', 'images/goods/20170226/1471798364441.jpg', '1', '1', '1', '1', '2017-02-25 21:44:43', '猫宁', null, null, '2017-12-20 06:38:18', '猫宁1', '小米MIX,小米手机,超大屏', '小米MIX', '小米MIX 全面屏概念手机，开创性的在6.4寸超大屏幕上，做到了惊人的91.3%。当你点亮屏幕的一瞬间，200多万颗像素的色彩，开满了整个屏幕。', '小米MIX,猫宁商城', null);
